    <div className="container">
      <h3>Number 1</h3>
      {numbers.map((num) => {
        return (
          <button onClick={() => firstNum(num)} value={num} className="btn">
            {num}
          </button>
        );
      })}

      <h3>Number 2</h3>
      {numbers.map((num) => {
        return (
          <button onClick={() => secondNum(num)} value={num} className="btn">
            {num}
          </button>
        );
      })}
    </div>
  );
};

